mapper.select:

select 

from TB_SITE_ANT_CONFIG_TEMP
where WORK_ID = #{WORK_ID,jdbcType=VARCHAR}
  and SITE_NO = #{SITE_NO,jdbcType=VARCHAR}
  and ANT_NO = #{ANT_NO,jdbcType=VARCHAR}

mapper.delete:

delete from TB_SITE_ANT_CONFIG_TEMP
where WORK_ID = #{WORK_ID,jdbcType=VARCHAR}
  and SITE_NO = #{SITE_NO,jdbcType=VARCHAR}
  and ANT_NO = #{ANT_NO,jdbcType=VARCHAR}
